import axios from "axios";

export const createProtocol = async (name, projectid, userid, islocal, orden) => {
  const response = await axios
    .post("http://localhost:5000/protocols", {
      name: name,
      project_id: projectid,
      user_id:userid,
      isLocal:islocal,
      order:orden
    })
    .then((response) => {
      console.log("la request paso", response)
      return response;
    })
    .catch((error) => {
      console.log(error);
    });
  return response;
};

export default createProject;
